import React, { Component } from "react";

export default class absoluteContent extends Component {
  render() {
    const { top, bottom, left, right, content } = this.props;
    return (
      <div style={{ top: top, left: left, right: right, bottom: bottom }}>
        {content}
      </div>
    );
  }
}
